package com.mem.vo.business.base.model.po;import java.util.Date;/** *  * <br> * <b>功能：</b>Area实体类<br> */public class Area{		/**	* 区域id 	*/	private Long id;	/**	* 场地id	*/	private Long placeId;	/**	* 区域名称	*/	private String areaName;	/**	* 区域颜色	*/	private String areaColor;	/**	* 	*/	private Date createTime;	/**	* 	*/	private String createUser;	/**	* 	*/	private Date updateTime;	/**	* 	*/	private String updateUser;	/**	* 删除标识  0 有效 1 无效	*/	private Integer isDelete;	/**	* 	*/	private Date ts;	public Long getId() {	    return this.id;	}	public void setId(Long id) {	    this.id=id;	}	public Long getPlaceId() {	    return this.placeId;	}	public void setPlaceId(Long placeId) {	    this.placeId=placeId;	}	public String getAreaName() {	    return this.areaName;	}	public void setAreaName(String areaName) {	    this.areaName=areaName;	}	public String getAreaColor() {	    return this.areaColor;	}	public void setAreaColor(String areaColor) {	    this.areaColor=areaColor;	}	public Date getCreateTime() {	    return this.createTime;	}	public void setCreateTime(Date createTime) {	    this.createTime=createTime;	}	public String getCreateUser() {	    return this.createUser;	}	public void setCreateUser(String createUser) {	    this.createUser=createUser;	}	public Date getUpdateTime() {	    return this.updateTime;	}	public void setUpdateTime(Date updateTime) {	    this.updateTime=updateTime;	}	public String getUpdateUser() {	    return this.updateUser;	}	public void setUpdateUser(String updateUser) {	    this.updateUser=updateUser;	}	public Integer getIsDelete() {	    return this.isDelete;	}	public void setIsDelete(Integer isDelete) {	    this.isDelete=isDelete;	}	public Date getTs() {	    return this.ts;	}	public void setTs(Date ts) {	    this.ts=ts;	}}